  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css'],
})
export class AppComponent{
  public users:Array<User> = [];


  public userObjectEmitterSubscriber(event:User):void{
    this.users.push(event);
    console.log(this.users)
  }

}
